    data: |
      SELECT - col2 AS col2 FROM tab2 WHERE - col1 * col0 + - col1 * - col2 NOT BETWEEN NULL AND ( col1 / - col1 + col2 * col0 * - col0 );
  - name: tab2

outputs:
  - name: q9470.out
    data: |
      -26
      -27
      -38
